import styles from './Log.module.css';

function Principal(){
    return(
        <section className={styles.section, styles.principal}>
            <h1>Cadastros</h1>
            <p>Nesta tela você tem acesso à todos os <span>Cadastros</span> já registrados no sistema</p>
        </section>
    )
}

export default Principal;
